import Card from './Card';

const Cardlist = ({ robots }) => {
    const CardComponent = robots.map(robofriend => {
        return (
            <Card id={robots[0].id} picture={robots[0].picture} name={robots[0].name} email={robots[0].email} />
        );
    }
    );
